import React from "react";
import "./skills.css";
import work from "../download/works.png";

class Skills extends React.Component {
    constructor(props) {
        super(props);
        this.state = {

        }
    }
    render() {
        return (
            <div className="work_content">
                <div className="work_img">
                    <img src={work} alt="work" />
                </div>
                <div className="skills_wapper">
                    <div className="skills_container">
                        <span>html</span>
                        <div className="load_slider_html">
                            
                        </div>
                    </div>
                    <div className="skills_container">
                        <span>css</span>
                        <div className="load_slider_css"></div>
                    </div>
                    <div className="skills_container">
                        <span>javascript</span>
                        <div className="load_slider_javascrit"></div>
                    </div>
                    <div className="skills_container">
                        <span>reactjs</span>
                        <div className="load_slider_reactjs"></div>
                    </div>
                    <div className="skills_container">
                        <span>c</span>
                        <div className="load_slider_c"></div>
                    </div>
                    <div className="skills_container">
                        <span>c++</span>
                        <div className="load_slider_c_plus_plus"></div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Skills;
